let canvas = document.querySelector("canvas");
let ctx = canvas.getContext("2d");
canvas.width = window.innerWidth / 2;
canvas.height = window.innerHeight / 2;

let particles = [];
let gravity = 1.9;
let friction = 0.98;

window.addEventListener("resize", function () {
  canvas.width = innerWidth;
  canvas.height = innerHeight;
  init();
});

function Particle(x, y, dx, dy, radius, color) {
  this.x = x + canvas.width / 2 - backgroundImage.width * 2;
  this.y = y + canvas.height / 2 - backgroundImage.width * 2;
  this.dx = dx;
  this.dy = dy;
  this.radius = radius;
  this.color = color;
}

Particle.prototype.draw = function () {
  ctx.beginPath();
  ctx.arc(this.x, this.y, this.radius, 0, Math.PI * 2, false);
  ctx.fillStyle = this.color;
  ctx.closePath();
  ctx.fill();
};

Particle.prototype.update = function () {
  if (this.y + this.radius + this.dy > canvas.height + this.radius) {
    this.dy = -this.dy;
    this.dy = this.dy * friction;
    this.dx = this.dx * friction;
  } else {
    this.dy += gravity;
  }

  if (
    this.x + this.radius + this.dx >= canvas.width ||
    this.x - this.radius + this.dx <= 0
  ) {
    this.dx = -this.dx * friction;
  }

  this.x += this.dx;
  this.y += this.dy;
  this.draw();
};

function randomVelocities(min, max) {
  return Math.floor(Math.random() * (max - min + 1) + min);
}

function animate() {
  ctx.clearRect(0, 0, canvas.width, canvas.height);

  for (let i = 0; i < particles.length; i++) {
    particles[i].update();
  }

  if (flag === true) {
    cancelAnimationFrame(animate);
    ctx.clearRect(0, 0, canvas.width, canvas.height);
    init();
    update();
  } else {
    requestAnimationFrame(animate);
  }
}

function init() {
  ctx.drawImage(backgroundImage, 0, 0);

  let imgData = ctx.getImageData(
    0,
    0,
    backgroundImage.width,
    backgroundImage.height
  );
  let imgDataArray = imgData.data;
  ctx.clearRect(0, 0, canvas.width, canvas.height);

  let height = imgData.height;
  let width = imgData.width;
  for (let i = 0; i < height; i++) {
    for (let j = 0; j < width; j++) {
      let pixelPosition = (width * i + j) * 4;
      // Version one: classic
      // if (imgDataArray[pixelPosition + 3] > 128) {
      //   let part = {
      //     x: j,
      //     y: i,
      //     color: `rgb(${imgDataArray[pixelPosition]}, ${
      //       imgDataArray[pixelPosition + 1]
      //     }, ${imgDataArray[pixelPosition + 2]})`,
      //   };
      //   particles.push(new Particle(part.x * 4, part.y * 4, 2, part.color));
      // }

      // Version two: troll
      if (imgDataArray[pixelPosition + 3] > 128) {
        let part = {
          x: j,
          y: i,
          color: `rgb(${imgDataArray[pixelPosition]}, ${
            imgDataArray[pixelPosition + 1]
          }, ${imgDataArray[pixelPosition + 2]})`,
        };
        particles.push(
          new Particle(
            part.x * 4,
            part.y * 4,
            randomVelocities(-9, 7),
            randomVelocities(-5, 5),
            Math.random() * 7,
            part.color
          )
        );
      }
    }
  }
}

let flag = false;

let backgroundImage = new Image();
backgroundImage.onload = init;
// backgroundImage.crossOrigin = "Anonymous";
// animate();

// normal state
let portrait = document.querySelector("#portrait");
portrait.addEventListener("click", (event) => {
  ctx.clearRect(0, 0, canvas.width, canvas.height);
  flag = true;
  for (let i = 0; i < particles.length; i++) {
    particles[i].draw();
  }
});

// crazy mode
let crazy = document.querySelector("#crazy");
crazy.addEventListener("click", (event) => {
  flag = false;

  animate();
});
backgroundImage.src =
  "data:image/png;base64,";
